import React from "react";
import "./BodyLowerSection.css";
const BodyLowerSection = () => {
  return (
    <div className="lower-section">
      <div className="lower-right-column">
        <div className="fire"></div>
      </div>
      <div className="lower-left-column">
        <div className="lower-column-content">
          <p className="lower-column-title">
            It’s Neapolitan
            <br /> or nothing.
          </p>
          <p className="lower-column-text">
            If you’re already a lover of Neapolitan pizza then you’ll know what
            we’re talking about – the taste, the texture, the pillowy crust, the
            chew. There is nothing like it and once you’ve experienced
            Neapolitan pizza it’s difficult to enjoy any other.
            <br /> <br />
            Neapolitan wood fired pizzas are an art, something we passionately
            imitate and something we celebrate – it’s what makes our difference
            and means you get the authentic taste experience.
          </p>
        </div>
      </div>
    </div>
  );
};
export default BodyLowerSection;
